import {
  Card,
  CardContent,
  Typography,
  TextField,
  Button,
} from "@mui/material";

function Login() {
  return (
    <Card sx={{ maxWidth: 400, margin: "auto", padding: 2, mt: 8 }}>
      <CardContent>
        <Typography variant="h5" component="div" gutterBottom>
          Login
        </Typography>
        <TextField label="Email" variant="outlined" fullWidth margin="normal" />
        <TextField
          label="Password"
          type="password"
          variant="outlined"
          fullWidth
          margin="normal"
        />
        <Button variant="contained" color="primary" fullWidth>
          Sign In
        </Button>
      </CardContent>
    </Card>
  );
}

export default Login;
